var title_f5_12_5313="Doppler estimation of RA RV gradient";
var content_f5_12_5313=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F63058&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F63058&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Doppler echocardiographic assessment of tricuspid regurgitation and the estimation of the gradient between right ventricle and right atrium",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 282px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the presence of tricuspid regurgitation a continuous wave Doppler can be passed from the apex to base across the tricuspid valve in the apical four chamber view (panel A) and the Doppler shift caused by the tricuspid regurgitation jet (TR) displayed (panel B). In this example, the peak velocity of the TR jet is 3 m/sec, which, by the Bernoulli equation, represents a 36 mmHg gradient (= 4 x 3 x 3) between right ventricle (RV) and right atrium (RA). If the RA pressure is known or can be estimated, the sum of RA pressure and the RA to RV gradient is equal to the peak pulmonary artery systolic pressure (assuming no pulmonary stenosis).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
