var title_f5_12_5325="Staph IE medical Rx in IDU";
var content_f5_12_5325=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F55417&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F55417&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medical management of staphylococcus aureus infective endocarditis in injection drug users",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Study",
"       </td>",
"       <td class=\"subtitle1\">",
"        Number with IE",
"       </td>",
"       <td class=\"subtitle1\">",
"        Valve involved",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antimicrobial regimen",
"       </td>",
"       <td class=\"subtitle1\">",
"        Outcomes/comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abrams et al, 1979",
"       </td>",
"       <td>",
"        25",
"       </td>",
"       <td>",
"        Right-sided (20), left-sided (2), both (3)",
"       </td>",
"       <td>",
"        Beta-lactam x 4 wks vs. beta-lactam x 4 wks plus gentamicin x 2 wks",
"       </td>",
"       <td>",
"        No treatment failures in either group",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Parker et al, 1980",
"       </td>",
"       <td>",
"        33 (29 with IDU)",
"       </td>",
"       <td>",
"        Right-sided (29), left-sided (4)",
"       </td>",
"       <td>",
"        Multiple IV regimens (mean duration 16 days), then multiple single PO regimens (mean duration 26 days)",
"       </td>",
"       <td>",
"        100 percent cure rate at 6 months; all patients male; mean total duration of therapy 42 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chambers et al, 1988",
"       </td>",
"       <td>",
"        53",
"       </td>",
"       <td>",
"        Right-sided",
"       </td>",
"       <td>",
"        Nafcillin plus tobramycin x 2 wks (vancomycin instead of nafcillin in 3 penicillin allergic patients)",
"       </td>",
"       <td>",
"        47 of 50 (94 percent) cured at 2 wks with nafcillin/ tobramycin, 1 of 3 (33 percent) with vancomycin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dworkin et al, 1989",
"       </td>",
"       <td>",
"        14",
"       </td>",
"       <td>",
"        Right-sided",
"       </td>",
"       <td>",
"        Ciprofloxacin (IV, then PO) plus rifampin x 4 wks",
"       </td>",
"       <td>",
"        10 of 14 completed therapy, all cured at 4 wks of follow-up",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Markowitz et al, 1992",
"       </td>",
"       <td>",
"        23",
"       </td>",
"       <td>",
"        Right-sided",
"       </td>",
"       <td>",
"        Trimethoprim-sulfamethoxazole (TMP-SMX) vs. vancomycin",
"       </td>",
"       <td>",
"        7 of 11 (64 percent) cured with TMP-SMX vs. 11 of of 12 (92 percent) with vancomycin; no treatment failures for MRSA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Torres-Tortosa et al, 1994",
"       </td>",
"       <td>",
"        139",
"       </td>",
"       <td>",
"        Right-sided",
"       </td>",
"       <td>",
"        Cloxacillin plus amikacin x 2 wks; chosen for good prognosis",
"       </td>",
"       <td>",
"        67 of 72 (93 percent) cured; 24 percent mortality in those with poor prognosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fortun et al, 1995",
"       </td>",
"       <td>",
"        16",
"       </td>",
"       <td>",
"        Right-sided",
"       </td>",
"       <td>",
"        Cloxacillin plus gentamicin x 2 wks vs. teicoplanin x 28 days",
"       </td>",
"       <td>",
"        Study stopped early due to high rate of failure in teicoplanin arm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Heldman et al, 1996",
"       </td>",
"       <td>",
"        85",
"       </td>",
"       <td>",
"        Right-sided",
"       </td>",
"       <td>",
"        Ciprofloxacin PO plus rifampin x 4 wks vs. oxacillin or vancomycin x 28 days plus gentamicin x 5 days",
"       </td>",
"       <td>",
"        Only 44 patients available for test of cure, bacteriologic",
"cure in 18 of 19 (95 percent) with PO regimen, 22 of 25 (88 percent)",
"with IV; definite IE in 15 patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Ribera et al, 1996",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        90",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Right-sided",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Cloxacillin x 2 wks vs. cloxacillin x 2 wks plus gentamicin x 7 days",
"       </td>",
"       <td>",
"        <strong>",
"         Intention-to-treat analysis:",
"        </strong>",
"        34 to 45 (76 percent) cured with cloxacillin vs. 31 to 45 (69 percent) with cloxacillin/gentamicin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Efficacy analysis:",
"        </strong>",
"        34 to 38 (89 percent) cure rate with monotherapy vs. 31 of 36 (86 percent) with combination regimen",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
